"use strict";
import logo from './IMG_0004.PNG';
import './App.css';
import * as React from 'react';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import Divider from '@mui/material/Divider';
import Typography from '@mui/material/Typography';
import Card from '@mui/material/Card';
import useSound from "use-sound";
import bowl from './A_resonant_trimmed_2.mp3';
import dong from './A_dong_trimmed.wav'


function App (){

  const [playDong, { stop }] = useSound(dong);

  return (
    <div className="App"> 

      <header className="App-header">

        <button onMouseEnter={() => playDong()} >
          <img src={logo} className="App-logo" alt="logo"/>
        </button>

        <a className = "Centering" >
          Centering
        </a>
        <Typography variant="h3" component="span" className = "Centering"> 
        hello
        </Typography>

      <Typography variant="h5" component="span"> 
        hello
      </Typography>
      </header> 

      <Typography variant="h5" component="span"> 
        hello
      </Typography>


    </div>
  );

}

export default App;
